public class Medium_451_SortCharactersByFrequency {
    public static void main(String args[]) {

        String a = "";
        System.out.println(My_frequencySort(a));
    }

    //桶排序,34ms
    public static String My_frequencySort(String s) {
        int[] frequecy = new int[256];
        int max = 0;
        for (char ch : s.toCharArray()) {
            frequecy[ch]++;
            max = Math.max(max, frequecy[ch]);
        }

        String[] bucket = new String[max + 1];
        for (int i = 0; i < frequecy.length; i++) {
            if (bucket[frequecy[i]] == null) {
                bucket[frequecy[i]] = "";
            }
            bucket[frequecy[i]] += (char) i;
        }

        StringBuilder res = new StringBuilder();
        for (int i = bucket.length - 1; i >= 0; i--) {
            if (bucket[i] != null)
                for (char ch : bucket[i].toCharArray()) {
                    for (int j = 0; j < i; j++)
                        res.append(ch);
                }
        }
        return res.toString();
    }

    //10ms,由于桶排序数据控件利用率很低，因此不需要桶排序，直接找distinct遍最大值即可。
    public static String frequencySort(String s) {
        if(s.length() == 0) return s;
        int[] freq = new int[256];
        char[] sArr = s.toCharArray();
        int distinct = 0;
        for(char c : sArr){
            if(freq[c] == 0) ++ distinct;
            ++ freq[c];
        }
        StringBuilder sb = new StringBuilder();
        while(distinct > 0){
            int max = Integer.MIN_VALUE;
            char maxC = 0;
            for(int i = 0; i < 256; ++ i){
                if(freq[i] > max){
                    max = freq[i];
                    maxC = (char)i;
                }
            }
            while(max > 0){
                sb.append(maxC);
                -- max;
            }
            -- distinct;
            freq[maxC] = 0;
        }
        return sb.toString();

    }
}
